import React, { useState, useEffect } from 'react';
import './AdminPage.css';

const AdminPage = () => {

  const [users, setUsers] = useState([]);
  const handleListUsers = () => {
    fetch('http://your-django-backend-url/api/users/')
            .then(response => {
                if (!response.ok) {
                    throw new Error('Failed to fetch users');
                }
                return response.json();
            })
            .then(data => {
                // Ensure that data is an array before setting the state
                if (Array.isArray(data)) {
                    setUsers(data);
                } else {
                    throw new Error('Invalid user data format');
                }
            })
            .catch(error => console.error('Error fetching users:', error));
  };







  return (

    <div>
      <div className="sidebar">
        <ul>
          <li onClick={handleListUsers}>Menu Item 1</li>
          <li>Menu Item 2</li>
          <li>Menu Item 3</li>
        </ul>
      </div>
      <div>
        <h2>Admin Panel</h2>
        <p>Welcome to the Admin Panel. You have access to administrative features.</p>
      </div>

      <div>

            <ul>
                {users.map(user => (
                    <li key={user.id}>{user.username} - {user.email}</li>
                ))}
            </ul>
        </div>


    </div>
  );
};

export default AdminPage;
